import React,{ Component } from 'react';

class ProductNew extends Component {
    constructor() {
        super();
        this.state= {
            stock: '',
            brand: '',
            type: '',
            price: ''
        }
    }
    stock(Event) {
        this.setState({
            brand: Event.target.value
        });
        console.log("Brand");
    }
    brand(Event) {
        this.setState({
            brand: Event.target.value
        });
        console.log("Brand");
    }
    type(Event) {
        this.setState({
            brand: Event.target.value
        });
    }
    price(Event) {
        this.setState({
            brand: Event.target.value
        });
    }
    newProduct(Evnent) {
        console.log("Hello New Product");
    }
    render() {
        return(
            <div className="dchannel-content productnew">
                <div style={{ padding: "10px"}}>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Stock</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.stock}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Brand</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.brand}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Type</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.type}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6">
                            <div className="row">
                                <div className="col-md-2">
                                    <label>Price</label>
                                </div>
                                <div className="col-md-10">
                                    <input type="text" onChange={this.price}/>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row di-mg">
                        <div className="col-md-6 text-right">
                            <button className="btn btn-gray" onClick={ () => this.newProduct}>SAVE</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default ProductNew;
